geo-analysis/controlPage/timeSetting.htm.body:
timeSetting

Receive time data after selecting KPI
Data structure
    {
        time: [
            {
                gorupId: 0,
                gorupDisplayName: "none",
                maskTitleList: [
                    {
                        maskTitle: "n/a",
                        maskList: [
                            {
                                maskId: 3,
                                maskDisplayName: "Hour",
                                itemList: [
                                    {
                                        itemId: 0,
                                        itemDisplayName: "None",
                                        visible: true,
                                        enabled: true
                                    }
                                ]
                            },
                            {
                                maskId: 4,
                                maskDisplayName: "Day",
                                itemList: [
                                    {
                                        itemId: 0,
                                        itemDisplayName: "None",
                                        visible: true,
                                        enabled: true
                                    }
                                ]
                            }
                        ]
                    }
                ]
            }
        ]
    }

flow

Get available hour: /rest/dataprovider-service/session/hourly/hour

geo-analysis/controlPage/scope.html.body:
scope

Receive scope data after selecting KPI. According to file /doc/api/config/config.json. Few properties such as 'multiLevel', 'search' ...etc, are added to item properties for later use.
Data structure
    {
        scope: [
            {
                groupId: 0,
                groupDisplayName: "none"
                maskTitleList: [
                    {
                        maskTitle: "Map View",
                        maskList: [
                            {
                                maskId: 9001,
                                itemList: [...]
                            }
                        ]
                    },
                    {
                        maskTite: "Network Element",
                        maskList: [
                            {
                                maskId: 4201,
                                maskDisplayName: "PU",
                                itemList: [
                                    {
                                        itemId: 4301,
                                        itemDisplayName: "PU",
                                        refTarget: "nt-service/display/tac",
                                        extraRefTarget: "NULL",
                                        extraRefCondition: "NULL",
                                        visible: true,
                                        enabled: true,
                                        urlToken: "tac"
                                    }
                                ]
                            },
                            ...
                        ]
                    },
                    {
                        maskTitle: "Polygon",
                        maskList: [
                            {
                                maskId: 9002,
                                itemList: [...]
                            }
                        ]
                    }
                ]
            }
        ]
    }

flow

fetch item data list: /rest/${refTarget}

geo-analysis/controlPage/condition.html.body:
condition

