        condition: [
            {
                groupId: 1,
                groupDisplayName: "Basic"
                maskTitleList: [
                    {
                        maskTitle: "Call Type",
                        maskList: [
                            {
                                maskId: 9301,
                                itemList: [
                                    {
                                        itemId: 9301,
                                        itemTitle: "",
                                        itemDisplayName: "Call Type",
                                        refTarget: "dimension-service/display/callType",
                                        refCondition: "",
                                        extraRefCondition: "3",
                                        visible: true,
                                        enabled: true,
                                        urlToken: "callType"
                                    }
                                ]
                            }
                        ]
                    }
                    ...
                ]
            },
            {
                groupId: 2,
                groupDisplayName: "Advanced",
                maskTitleList: [
                    {
                        maskTitle: "Subscriber",
